import './App.css';


class App extends React.Component{

  constructor(props){
    super(props)
    this.state = {
     todos: ['1' , '2' , ]
    }
  }


  render(){
    return (
      <div className = "container">
        <h2> ToDo:</h2>
        <ul>
          <li ></li>
        </ul>
      </div>
    )
  }
}

export default App;
